import styles from './Leftcard.module.css';
import React from 'react';


function Leftcard() {
    return (
        <div className={styles.leftcard}>
            <div className={styles.leftcardcontent}>
                <div className={styles.uppercont}>
                    <div className={styles.leftcardlogo}>
                        <img src="../images/Vector_3.png" alt='' />
                    </div>
                    <h1 className={styles.leftcardheading}>Welcome to the world of learning</h1>
                    <p className={styles.leftcardtext}>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                </div>
            </div>
            <div>
                    <button className={styles.leftcardbutton}>Register</button>
            </div>
        </div>
    );
}

export default Leftcard;
